		        if (nextSlideIndex === 8) {
		            nextSlideIndex += 6; // Skip to the slide after the skipped one
		            $('#homeSlick').slick('slickGoTo', nextSlideIndex);
		        }else{
		        	mySlider.slick('slickNext'); // Go to the previous slide
		        }
		        

		        // Get the currently active element with the 'active' class
				var currentActive = $('.sdg.active');

				// Remove the 'active' class from the current active element
				currentActive.removeClass('active');

				// Get the next element with the class 'sdg'
				var nextElement = currentActive.next('.sdg');
			
				// If there is no next element, wrap around to the first element
				if (nextElement.length === 0) {
					nextElement = $('.sdg:first');
				}else{
					var nextselectedslide = `.sdg-${nextSlideIndex+1}`				
					nextElement = $(nextselectedslide);
				}
				
				// Add the 'active' class to the next element
				nextElement.addClass('active');
		        
		    });

		     $('.custom-prev').on('click', function() {
		     	 var currentSlideIndex = mySlider.slick('slickCurrentSlide');
		        var nextSlideIndex = currentSlideIndex + 1;
		       
		     	if (nextSlideIndex === 15) {
		     		nextSlideIndex = 9;
		            // alert(nextSlideIndex)
		            $('#homeSlick').slick('slickGoTo', 7);
		        }else{
		        	mySlider.slick('slickPrev'); // Go to the previous slide
		        }

		        // Get the currently active element with the 'active' class
				var currentActive = $('.sdg.active');

				// Remove the 'active' class from the current active element
				currentActive.removeClass('active');

				// Get the previous element with the class 'sdg'
				var prevElement = currentActive.prev('.sdg');

				// If there is no previous element, wrap around to the last element
				if (prevElement.length === 0) {
					prevElement = $('.sdg:last');
				}else{
					var selectedslide = `.sdg-${nextSlideIndex-1}`
					prevElement = $(selectedslide);
				}
				
				

				// alert(`.sdg-${nextSlideIndex}`)
				// Add the 'active' class to the previous element
				prevElement.addClass('active');
		        
		    });


